      <p>Buy Fresh is a Professional eCommerece Platform. Here we will provide you only interesting content, which you will like very much. We're dedicated to providing you the best of eCommerece, with a focus on dependability and Online Grocery Shopping. We're working to turn our passion for eCommerece into a booming online website. We hope you enjoy our eCommerece as much as we enjoy offering them to you</p>
      <h3>Thanks for Visiting Our Site!</h3>
    </Layout>
  )
}

export default About
